(101, 'Jessy', 'Little Dragon, sort son 4ème album intitulé Nabuma Rubberband.', '<p>Avec leur quatrième album, les trublions stylés de Little Dragon réveillent le r’n’b moite et mainstream de notre adolescence. Après avoir obtenu une reconnaissance internationale avec le survolté Ritual Union, les Suédois reviennent à un son plus épuré, nimbé dans la pop brumeuse et sensuelle des années 90. Escortée de rythmiques r’n’b, la chanteuse suédo-nipponne Yukimi Nagano hypnotise de sa voix soul aux aigus frêles, non sans rappeler l’excellent album The Velvet Rope de Janet Jackson. Meilleur exemple : le délicat Pretty Girls, qui s’impose déjà comme un indispensable de nos compils estivales, bien calé entre un tube de Prince et un morceau ambient de James Blake.          </p>', NULL, 'little-dragon.jpg', '2016-05-09 12:27:44');
INSERT INTO `news` (`id`, `author`, `title`, `content`, `rating`, `picture`, `creation_date`) VALUES
(102, 'Jon', 'Le nouvel album de The Roots en écoute', '<p>L’album est d’ores et déjà en écoute sur le site américain Pitchfork en suivant ce lien. Ci-dessous le clip du titre When The People Cheer, premier extrait dévoilé de l’album.<br>Sur ce treizième album, on retrouve les membres fondateurs du groupe Questlove et Black Thought, accompagnés comme à leur habitude de nombreux collaborateurs de tous horizons.<br><br>Après Undun en 2011 et Wise Up Ghost, un album commun avec Elvis Costello en 2013, la fièvre créatrice de The Roots a de nouveau frappé avec l’étrangement nommé …And Then You Shot You Cousin, dont la sortie est annoncée pour le 18 Mai prochain.<br><br>The Roots est de retour avec “…And Then You Shot You Cousin”, un nouvel album déjà disponible à l’écoute sur le site de Pitchfork.<br>          </p>', NULL, 'the-roots.jpg', '2016-05-09 13:08:45'),
(103, 'Yan', 'Portishead rend les trentenaires nostalgiques à la Route du rock', '<p>Le groupe britannique devrait provoquer la même montée de nostalgie le week-end prochain pour le festival Rock en Seine.Pour beaucoup des 14.000 personnes réunies ce vendredi soir au Fort Saint-Père, c''était aussi l''occasion de réveiller de vieux souvenirs musicaux.<br>Seize ans après leur dernier passage sur la scène du festival malouin, le groupe britannique a tenu à lécher sa prestation scénique, mêlant vidéos envoutantes et gros plan sur la charismatique chanteuse Beth Gibbons.</p><p><br>"J''ai plané pendant une heure et vingt minutes" Le reportage de Sandrine Etoa-Andegue<br>Même avec des bottes biens enfoncées dans la boue bretonne, le public de la Route du rock semble avoir pris son envol samedi soir à l''écoute Portishead.<br>C''est comme si le public de la Route du rock avait sorti son vieux baladeur d''un tiroir poussiéreux pour le rembobiner à l''aide d''un stylo jusqu''en 1995. Seize ans après leur premier passage à Saint-Malo, le groupe britannique semble avoir réveillé beaucoup de souvenirs vendredi soir sur la scène du Fort Saint-Père.<br>          </p>', NULL, 'portishead.jpg', '2016-05-09 13:09:56'),
(104, 'Séverin', 'Hadouken! fait un break', '<p>Source : Sound of Violence<br>Les membres de Hadouken! ont annoncé, via leur compte facebook, la mise entre parenthèses de leur groupe afin de se consacrer divers projets.&nbsp; James Smith travaille sur ses propres chansons tandis que Dan Rice, Nick Rice et Chris Purcell enregistrent actuellement au sein d''un nouveau groupe : Cast of Lions.<br>          </p>', NULL, 'hadouken.jpg', '2016-05-09 13:14:21');
INSERT INTO `review` (`id`, `author`, `title`, `content`, `picture`, `creation_date`) VALUES
(4, 'Jessy', 'Portishead - Third', 'Privé de tout confort, l’auditeur doit, quant à lui, dépasser l’impression première de traverser un disque en travaux, dissiper la troublante sensation d’être confronté à une œuvre si brute qu’elle paraît parfois inachevée. Il faut s’y faire : exprimés et assouvis sans le moindre compromis, les désirs de Portishead font aujourd’hui désordre. Fatigués et pourtant rayonnants, tels deux explorateurs ayant survécu à une invraisemblable odyssée, ils décrivent avec un plaisir palpable les deux sentiments qui les habitent et les animent : la satisfaction du travail de sape accompli, et la joie d’avoir modelé un nouveau langage qui, enfin, répond à leurs plus hautes exigences.<br><p>Même si elle continue de creuser dans ses textes des obsessions très personnelles, Beth Gibbons, elle, ne chante plus comme une princesse emmurée dans son donjon, perchée dans quelque haute et inaccessible solitude. Impliquée comme jamais, promue au rang de réalisatrice sonore au même titre que l’apprenti sorcier Geoff Barrow et le guitariste Adrian Utley, elle participe activement à un chaos dont on devine qu’il lui aura été aussi inconfortable que libérateur. Désormais, sa voix est à la fois le point focal et l’insaisissable ligne de fuite d’un paysage sonore moins enchanteur qu’en chantier, en recomposition permanente.</p><p><br>grésillements de vieux vinyles – qui ornaient la surface de Dummy et de Portishead. Leur musique n’est plus une forteresse imprenable, close sur elle-même, comme imperméable aux turbulences du monde extérieur. Elle laisse aujourd’hui entrer de violents courants d’air qui, de mélodies répétitives dignes du krautrock en pilonnages rythmiques, de perturbations électroniques en distorsions sonores, lui donnent l’aspect d’un poste avancé en terrain hostile, assailli de toutes parts par des forces qui menacent à tout moment de la réduire en poussière.</p><p><br>Les Anglais n’ont pas détruit le majestueux palais des glaces à partir duquel ils avaient fondé et étendu leur royaume. Mais ils en ont considérablement bouleversé les plans et les structures, et ils en ont également décapé les murs, débarrassés de tous les tags sonores – scratches, samples et autres<br>Oubliez la perfection plastique de ses chansons passées, qui donnait une tonalité classique à un langage paré de tous les signes de la postmodernité, recyclant à froid des éléments arrachés au hip-hop, à la soul, à la pop, aux musiques de films, au jazz ou au blues. Le visage de Portishead, aujourd’hui, n’est le plus souvent que traits accidentés, angles vifs et profils taillés à la serpe. Avec Third, le trio ne s’est pas contenté de déchirer une bonne fois pour toutes le cliché encombrant de “groupe fondateur du courant trip-hop” qui lui collait au front : il s’est complètement refait le portrait, au point d’en être parfois méconnaissable. Ce ravalement de façade plutôt radical n’est pas sans évoquer les gros travaux de rafraîchissement entrepris jadis par Radiohead dans Kid A.<br>Depuis quelques mois, la rumeur annonçait le grand retour de Portishead après dix ans d’hibernation volontaire. La rumeur se trompait : elle aurait dû évoquer le grand départ de Portishead. Car c’est bien un bond en avant, et non une remontée aux sources, que le groupe de Bristol accomplit sur son nouvel album. La distance qui sépare Third de la trilogie formée par Dummy (1994), Portishead (1997) et le live Roseland NYC (1998) ne s’inscrit pas que dans le temps : elle s’imprime aussi et surtout dans l’espace, tant le fossé esthétique qu’elle creuse est marqué. Quand beaucoup de vieux groupes endormis jugent bon de se reformer, Portishead, lui, a choisi de se transformer.<br><br>Après dix ans de silence radio, Portishead émet à nouveau. le groupe culte de Bristol navigue désormais sur des eaux tempétueuses qui l’éloignent de son passé et l’imposent comme un grand explorateur sonore.<br>          </p>', 'portishead-third.jpg', '2016-05-09 10:23:09'),
(6, 'Jessy', 'La voix têtue de Little Dragon', '<p>Depuis deux ans, Little Dragon a écumé les scènes du monde entier, et s''est même payé le luxe d''ouvrir les plus grandes pour Gorillaz, décidément fan du groupe. Le 12 mai, ils mettront un point final à cette interminable tournée afin de se consacrer à leur troisième album, prévu au printemps.<br><br>Intrigante, fragile, la musique de Little Dragon emprunte au R&amp;B sa tendresse, à l''électro sa finesse, à la pop ses mélodies gracieuses. A l''image de la pochette de Machine Dream, réalisée par l''artiste japonais Hideyuki Katsumata, qui, dit-il, peint sur les frontières pour les effacer. Ses dessins ressemblent d''ailleurs au croisement de différents folklore asiatiques, du Japon à l''Indonésie. La première pochette avait été réalisé par le père, Yukimi Nagnago, dessinateur.<br><br>Signé sur Peacefrog (label historique de la house music, auquel on doit les albums de l''inénarrable producteur américain Moodymann ou les chefs-d''œuvre délicats de Charles Webster), Little Dragon a déjà publié deux albums. Debut en 2007 et Machine Dreams en 2009. Un disque au succès confidentiel, mais qui a peu à peu gagné le cœur du monde, au point de bénéficier d''une deuxième sortie cet hiver.<br><br>Certaines chanteuses inspirent plus que d''autres. Yukimi Nagnago en fait partie. Invitée par Damon Albarn sur le dernier disque de Gorillaz, elle lui a donné ses meilleurs chansons (Empire Ants, To binge). Elle a aussi été embarquée par David Sitek, l''âme du groupe new-yorkais TV On The Radio, pour son projet electro Maximum Balloon, réalisé, lui, à Los Angeles. Mais la vraie maison de Yukimi Nagnago est en Suède, auprès de son groupe, Little Dragon.<br><br>La chanteuse suédoise Yukimi Nagnago a prêté sa voix à deux des succès pop de l''année 2010, Gorillaz et Maximum Balloon, le projet électro de David Sitek. Elle revient à Paris avec son vrai groupe, Little Dragon, pour un concert le 11 février.<br>          </p>', 'little-dragon-machine-dream.jpg', '2016-05-09 10:35:59'),
(7, 'Séverin', 'Hadouken! For The Masses', '<p>Même si Hadouken ! ne propose toujours rien de véritablement novateur, sa musique s’en trouve désormais plus cohérente et captivante. Si For The Masses est loin d’être l’album de l’année, on lui trouve un certain charme, déjà désuet, et, sans le considérer comme véritablement réussi car toujours trop peu personnel, on avoue ne pas bouder son plaisir sur une bonne moitié des compositions.<br><br>Poursuivant sur sa lancée et se bonifiant, voire s’intensifiant au fil des titres, Hadouken ! sort graduellement de sa légendaire torpeur pour lâcher quelques brûlots incandescents à l’instar du virevoltant House Is Falling Down et du lancinant et obsessionnel Ugly résolument dans une veine Prodigienne. Et pour preuve qu’il ne faut jamais désespérer, les mélodies de Lost et Retaliate qui finissent par accrocher nos oreilles et séduire nos tympans grâce à leurs accords jubilatoires tout droit hérités d’un vieil Atari des années quatre-vingts.<br><br>Force est de constater que, las, l’affaire s’engage assez mal pour le combo avec trois premières compositions à l’insipidité rare, depuis l’ampoulé et morne Rebirth, jusqu’au déjà connu et détesté M.A.D. Ainsi tous les espoirs reposent-ils sur les frêles épaules des huit titres suivants. Par bonheur, Evil, par le biais de sa rythmique électro-indus syncopée ainsi que de son chant détaché et éthéré, suscite notre intérêt et nous permet de prendre notre mal en patience jusqu’au refrain entraînant et non dénué de subtilité.<br><br>Après trois bonnes années de livraisons discographiques plus hype et désastreuses les unes que les autres, avec en point d’orgue un premier album de bien piètre facture paru il y a quasiment deux ans, le quintette clone un temps de Klaxons en hibernation depuis des lustres, joue sa dernière carte pour tenter de convaincre un auditoire de plus en plus sceptique. En effet, comme le martèle le second titre de l’opus, le poussiéreux Turn The Lights Out, ceci est leur dernière chance.<br>          </p>', 'hadouken-for-the-masses.jpg', '2016-05-09 10:37:01'),
(8, 'Jon', 'The Roots - How I Got Over', '<p>Ce How I Got Over n''atteint sans doute pas les sommets que constituent Things Fall Appart, Phrenology ou Game Theory, mais vient s''ajouter honorablement à l''irréprochable discographie des Américains. On peut leur reprocher parfois quelques facilités, mais les Roots avancent sans compromission tout en prenant le risque d''être prolifique. Assez rare pour être salué.<br>Il manque la surprise ! Les musiciens de Philly n''ont pas passé un an à jouer dans le talk show de Jimmy Fallon (écoutez l''excellent Late Night With The Roots) pour ne resservir qu''une recette si classique, aussi réussie soit elle. Cela serait oublier leur talent d''innovateur qui réapparaît sur les deux derniers extraits. D''abord sur Web 20/20 (avec Peedi Peedi et Truck North) et son instru que ne renierait pas les figures du liquid hip-hop de la côte ouest puis sur Hustla (avec STS) où cohabitent une basse imposante et un curieux son de cornemuse. Vous n''avez pas encore tout compris que l''album s''arrête. Il faudra plusieurs écoutes pour en apprécier toute la richesse et les multiples saveurs au-delà de la claque que les Roots s''appliquent à donner à chacune de leurs sorties.<br><br>Les Roots débutent habituellement leurs albums et leurs concerts pied au plancher, les morceaux fusent et l''attention est captée automatiquement emportée par la fougue et la maîtrise. Après un Rising Down extrêmement dense, avec des instrus coup de poing parfois sombres, la bande a toutefois décidé de changer complètement de formule. L''intro se fait donc tout en douceur, les premiers titres déroulent leur soul tranquillement, même si les Américains ne savent se détacher d''une certaine intensité, liée à l''urgence du flow de leur leader et animateur. Derrière, Questlove cogne toujours autant et apporte sa science pour construire des productions imparables. L''attelage fait donc monter l''ambiance jusqu''au tube How I Got Over dont le refrain chanté garanti le succès. Et c''est là une des forces du combo, construire des hits sans se compromettre (de You Got Me à The Seed (2.0)), voire même verser dans un style proche du R''n''B sans tomber dans le mièvre. Ainsi The Day avec Blu, Phonte et Patty Crash apporte une petite respiration tandis que Joanna Newsom vient contrecarrer de sa voix légère la lourde rythmique de Right On. La jeune chanteuse ira sans doute rejoindre les nombreux artistes talentueux soutenus par les Roots au début de leur carrière, comme Erykah Badu, Jill Scott, Cody Chesnutt, etc. Les interventions de John Legend, plus proche de la fin de carrière que du début, sur Doin'' It Again et The Fire sont quand à elles un peu moins utiles... Le disque monte peu à peu en puissance et la soul du début devient un rap plus dur dans lequel Black Thought règne toujours en maître.<br><br>Une légende doit s''entretenir. Le groupe de Philadelphie n''a jamais manqué d''inspiration pour entretenir sa propre légende qu''il auto-proclame à longueur de concert et sur son site officiel. "The Legendary Roots Crew" dispense les albums avec générosité tout en maintenant un très haut niveau de qualité. Leur discographie peut être disséquée en termes de cycles, autour de l''intelligente rupture que constitue Phrenology en 2002, mais peut surtout s''apprécier de manière globale. A l''heure du neuvième album, le troisième pour l''écurie de légende Def Jam, où le MC Black Thought et le batteur Questlove sont-ils allés chercher de nouvelles cartouches ? Dans leur propre culture soul tout d''abord, puis dans leur sens innée de la mélodie. Kamal au clavier et Captain Kirk à la guitare et au chant ont également apporté leur touche. Le groupe est une famille qui accueille de plus en plus de proches à chaque sortie. Il y a quelques habitués devenus incontournables comme Dice Raw, P.O.R.N. ou Truck North et des invités plus ponctuels, notamment, pour ce How I Got Over, John Legend.<br><br>Label : Def Jam<br><br>Sortie : juin 2010<br>          </p>', 'the-roots-how-i-got-over.jpg', '2016-05-09 10:40:31'),
(9, 'Yan', 'Black on both sides', '<p>Depuis Universal magnetic, maxi d’anthologie, on a suivi fébrilement Mos Def à la trace, d’abord sur son très beau projet Black Star (avec Talib Kweli), puis lors de ses visites d’amitié – chez Common, A Tribe Called Quest, High &amp; Mighty et les Roots – jusqu’à son premier album solo dont il est question ici, l’un des plus grands albums de 1999. Disque que l’on apprécia d’emblée pour sa diversité, sa sincérité, son engagement, sa chaleur, et qu’on adule aujourd’hui pour son infinie générosité, ses infinies subtilités, son courage, son humour et sa grâce. A l’égard de sa communauté, Mos Def fait à la fois preuve de compassion et d’une rage indignée, celle d’un père dont on aurait molesté la progéniture. Sentiments qui le disputent donc à parts égales dans ce disque, mais toujours sans emphase, qu’il s’agisse d’apaiser en insufflant un peu de sagesse (sublimes et inspirés Love et Umi) ou de dénoncer l’internationale du racisme (Mr Nigga) et la société pousse-au-crime (Mathematics). En digne héritier des Native Tongues (De La Soul, A Tribe Called Quest), Mos Def a une conscience aiguë de sa mission, même si son propos est nettement plus offensif, voire provocateur. Mais au-delà des mots, portés par ce timbre à part, ce phrasé sensuel, louvoyant entre rap, chant, scat et ragga, c’est à la musique qu’on s’attachera en priorité, à ces mélodies gorgées de soul auxquelles Mos Def a souvent apporté sa patte : aux percussions, à la basse, au vibraphone ou à la production, comme sur le superbe instrumental May-December qui conclut magiquement ce disque. La promesse d’un Graal absolu pour son second album attendu cette année, après sa consécration en tant qu’acteur dans le prochain Spike Lee.<br>Depuis Universal magnetic, maxi d’anthologie, on a suivi fébrilement Mos Def à la trace, d’abord sur son très beau projet Black Star (avec Talib Kweli), puis lors de ses visites d’amitié – chez Common, A Tribe Called Quest, High &amp; Mighty et les Roots – jusqu’à son premier album solo dont il est question ici, […]<br><br>Rawkus - Pias<br>Mos Def - Black on both sides<br>          </p>', 'mos-def-black-of-both-sides.jpg', '2016-05-09 10:41:00');
